import React, {Component} from 'react';

export class Fact extends Component {

    render() {
        console.log("hej4")
        const fact = this.props.fact;
        console.log(fact);

        for(let i=0; i < fact.length; i++){
            return (
                <div>
                    <p>{ fact[i].text }</p>
                </div>
            )
    }
}
}

export default Fact;
